import React from 'react'
import { useEffect } from 'react';
import { useState } from 'react';
import { getDishes } from '../../services/dish';


function ListDish() {
    const [dish, setDish] = useState([]);

    useEffect(() => {
        getDishes()
        .then((res) => {
            console.log(res);
        })
        .catch((error) => {
            console.log(error);
        })
    }, [dish])



    return (
        <div className='container'>
            <table id="customers">
                <tr>
                    <th>Dish name</th>
                    <th>Variety</th>
                    <th>Qty</th>
                    <th>price</th>
                </tr>
                <tr>
            <td>hi</td>
            <td>fh</td>
            <td>rsgd</td>
            <td>fdbj</td>
        </tr>


            </table>
        </div>
    )
}

export default ListDish
